import React from 'react';
import image3 from "./image3/image3.png";

export default function Image3() {
    return (
        <div
            style={{
                borderRadius: "3px",
                height: "130px",
                width: "130px",
                boxShadow: "3px 3px 3px #b4beb7"
            }}
        >
            <img src={image3} width="130px" alt="" />
        </div>
    )
}
